import React, { Component } from 'react';

class Logo_mpt extends Component{
    render(){
        return (
         <Image 
            style= { style,imgstyle}
            source = { required( './src/imgs/calculadora.png' )}
         >
         </Image>
        )
    }
}

const styles = StyleSheet.create({
    imgstyle:{
        width:100,
        height: 100,
        marginTop: 30
    }

}
);
export default Logo_mpt;
